# yaml-language-server: $schema=../.schema.yaml
title: Centers for Disease Control and Prevention (CDC) Nursing Home Public Health
  Response Network (NHPHRN)
url: https://github.com/abtassociates/CDC_NHPHRN/blob/main/
description: >
  The INHERENT study, part of the CDC funded Nursing Home Public Health Response Network
  (NHPHRN), examined SARSCoV2 shedding in nursing home residents and staff. It characterized
  the viral shedding kinetics including proliferation, peak, and clearance using qRTPCR,
  antigen testing, genetic sequencing, and culture. The original dataset is published
  and updated on their GitHub repository (https://github.com/abtassociates/CDC_NHPHRN/blob/main/).
analytes:
  NP_SARSCoV2_VL:
    description: >
      Viral concentrations were quantified using RTqPCR targeting the N and S genes
      in nasopharyngeal swab samples with the TaqPath COVID19, Flu A, Flu B Combo
      Kit. One nasal swab was processed using the TaqPath Combo Kit on the QuantStudio
      7 Pro, which provided results for all three analytes. For specimens with a SARSCoV2
      cycle threshold (Ct) value below 30, a second analysis was performed using the
      CDC Influenza SARSCoV2 (Flu SC2) Multiplex Assay on the ABT 7500 Fast Dx. The
      reference event, "confirmation date", is defined as the date of the initial
      positive test.
    limit_of_quantification: 10000
    limit_of_detection: unknown
    specimen: nasopharyngeal_swab
    biomarker: SARS-CoV-2
    gene_target: S and N
    unit: gc/mL
    reference_event: confirmation date
  NP_SARSCoV2_CT:
    description: >
      Cycle threshold (Ct) values were measured using RTqPCR targeting the N and S
      genes in nasopharyngeal swab samples with the TaqPath COVID19, Flu A, Flu B
      Combo Kit. One nasal swab was processed using the TaqPath Combo Kit on the QuantStudio
      7 Pro, which provided results for all three analytes. For specimens with a SARSCoV2
      cycle threshold value below 30, a second analysis was performed using the CDC
      Influenza SARSCoV2 (Flu SC2) Multiplex Assay on the ABT 7500 Fast Dx. The reference
      event, "confirmation date", is defined as the date of the initial positive test.
    limit_of_quantification: unknown
    limit_of_detection: 37
    specimen: nasopharyngeal_swab
    biomarker: SARS-CoV-2
    gene_target: S and N
    unit: cycle threshold
    reference_event: confirmation date
